import './App.css';
import './styles.css';
import Navbar from './Navbar';

function App() {
  let Component;

  switch (window.location.pathname) {
    case "/":
      Component = App;
      break;
    case "/pricing":
      Component = Component;
      break;
    case "/about":
      Component = About;
      break;
  }

  return (
    <>
      <Navbar></Navbar>
      <Component></Component>
    </>
  );
}

export default App;
